Think of the case: 1) user open this background Tab. 2) tap the tab switcher button and enter the tab switcher. 3) choose the background tab from the tab switcher again. 4) on the background tab, taps the back button. There are many steps are done before it returns to the Start surface, do you still want to close this background tab? I'm fine with deleting the tab here, but just want to make sure that you really want to delete this tab in such a case.

Actually, I think this could be:
if (type == TabLaunchType.FROM_LONGPRESS_BACKGROUND && !StartSurfaceUserData.getKeepTab(currentTab)) {
  getCurrentTabModel().closeTab(currentTab);
}

StartSurfaceUserData.setKeepTab() is called when user taps either home button or tab switcher button on the tab. It distinguishes the cases that tapping the back button directly after opening the tab from the cases that user does multiple other steps. Wdyt?

