would it suffice to call 

  OmniboxTestUtils.toggleUrlBarFocus(urlBar, true);

instead? i would prefer that we don't add new methods to UrlBar.java if possible. this call does exactly what you want (and i'm looking into making this the default way to run omnibox tests while simplifying the testutils class)

could the same be achieved by 

  OmniboxTestUtils.toggleUrlBarFocus(urlBar, false);

or is explicit key press required here? (doesn't seem to be the case looking at the test, so maybe we could make it simpler?)

Here you could do something like UndobarControllerTest's then assert on properties for that snackbar.


